import React from 'react';
import '/.Layout.css';

const Layout =({children}) =>{
    return(
        <>
        <div>
            <header className="header"></header>
            <div className="asmain">
            <aside/>
            <main/></div>
        </div>
        <main>{children}</main>
        </>
    )
}

export default Layout;
